// 4 Juni 2019
// Filename: home/index.js
// Description: The home page made for foxdale blog and testimonial
// mangement.
import React, { Component } from 'react'
import { Row, Col, List } from 'antd';
import ListHeader from '../../components/listHeader';

const styles = {
  container: {
    backgroundColor: '#ffae19',
    height: 800,
    width: '100%'
  },
  row: {
    flexDirection: 'row',
    backgroundColor: '#fff'
  },
  list: {
    paddingTop: '30%'
  }
}

export default class Home extends Component{
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div style={styles.container}>
          <img src='https://foxdale.s3.amazonaws.com/media/fox_head.png' />
          <Row type="flex" style={styles.row}>
            <Col span={12}>
              <List
                header={<ListHeader header="Testimonies" />}
                bordered
                style={styles.list}
                renderItem={item => (
                  <List.Item>
                    <h1>hi</h1>
                  </List.Item>
                )}
              />
            </Col>
            <Col span={12}>
              <List
                header={<ListHeader header="Blog Posts" />}
                bordered
                renderItem={item => (
                  <List.Item>
                    <h1>hi</h1>
                  </List.Item>
                )}
              />
            </Col>
          </Row>
      </div>
    );
  }
};
